#Creates a default report PATH based on the current date and time
def reportName():
    from datetime import datetime
    return os.getcwd()+'\\report_'+datetime.now().strftime('%Y_%H%M%S')+'.html'

#Returns a list of all file names in the working directory
def getFilesInDir():
    return  os.listdir(os.getcwd())

#Saves the default report and returns the open file for future writes
def createReport(reportFile):
    for file in getFilesInDir():
        if file == reportFile:
            os.remove(reportFile)
            break
    return open(reportFile, 'w')

#Automagically attempts to find a supported file in the same working directory
def automagicallyFindFile():
    files = getFilesInDir()
    if debug: 
        s = ", "
        print("\nFiles: '"+s.join(files)+"'")
    sFile = getSupportedFile(files)
    if sFile == None:
        generateReport(createReport(reportName()), None, True)
        openReport(reportName())
        exit()
    else:
        return os.getcwd()+'\\'+sFile

#Returns the first supported file, or None if no supported files exist
def getSupportedFile(fileList):
    for file in fileList:
        if isListFile(file):
            if debug: print("\n'"+file+"' is a List File!")
            return file
    return None

#Opens the generated report in default browser. A report will
#always be generated.
def openReport(file):
    import webbrowser
    webbrowser.open(file, new=2)
    if debug: print("\nReport opened.")

#Returns True if input filename is a supported extension. Otherwise returns False.
def isListFile(file):
    if file.lower().endswith('.txt') or file.lower().endswith('.csv') or file.lower().endswith('.xls'):
        return True
    else:
        return False
 
