#Gets the indexes of 'randy' and 'adam' (other method checks to make sure they are not on same team)
def getVipIndexes(teamList):
    vips = []
    for person in teamList:
        if debug: print('Person: '+str(person))
        if debug: print('person.lower(): '+str(person).lower())
        if 'randy' in str(person).lower() or 'adam' in str(person).lower():
            if debug: print(str(person)+' matches randy or adam!')
            if debug: print('Matching Index: '+str(teamList.index(person)))
            vips.append(teamList.index(person))
    if debug: print('vip0: '+str(vips[0]))
    if debug: print('vip1: '+str(vips[1]))
    if debug: print('#VIPs: '+str(len(vips)))
    vips.sort()
    return vips
 
#Randomizes a list of people and divides it into teams of 5-6. Returns the 
#generated teams into a list of lists
def getTeams(rawList):
    import random
    import math
    
    teamNums = [] #how many people/team
    teams = [] #array of arrays
    random.shuffle(rawList) #shuffle to prevent alpha-numeric sorting
    if debug: print(str(len(rawList))+' items found in rawList.')
    
    #ensure Randy & Adam are on different teams
    vips = getVipIndexes(rawList)
    if debug: print('vip[0]: '+ str(vips[0]))
    if debug: print('vip[1]: '+ str(vips[1]))
    
    if debug: print('VIP 0 Team#: '+ str(math.floor(vips[0]/6)))
    if debug: print('VIP 1 Team#: '+ str(math.floor(vips[1]/6)))
    while math.floor(vips[0]/6) == math.floor(vips[1]/6):
        random.shuffle(rawList)
        vips = getVipIndexes(rawList)
    
    total = len(rawList)
    dSix = math.floor(total/6) #teams of 6, round down
    if debug: print('Teams of 6: '+ str(dSix))
    
    #determine team #'s
    for num in list(range(dSix)):
        teamNums.append(6)
    if debug: print('Cross-check Teams of 6: '+ str(len(teamNums)))
        
    #determine remainder
    if total-(6*dSix) > 0:
        teamNums.append(total-(6*dSix))
        if debug: print('Remainder (# in last team): '+ str(teamNums[-1]))
        
    if debug: 
        print('Original Team #s: ')
        print(*teamNums, sep = ", ")
        
    #Even out teams to >= 5 people, if there is remainder
    if teamNums[-1] < 5: 
        if debug: print('Remainder: '+ str(teamNums[-1] < 5))
        increment = 0
        for team in teamNums:
            teamNums[teamNums.index(team)] -= 1
            increment += 1
        teamNums[-1] += increment

    if debug: 
        print('Modified Team #s: ')
        print(*teamNums, sep = ", ")

    #validate totals & team division
    actualTotal = 0
    for tm in teamNums:
        actualTotal += tm
    if total != actualTotal:
        if debug: print('ERROR! Team total does not match original total!')
        if debug: print('Original total: '+str(total))
        if debug: print('Actual total: '+str(actualTotal))
        generateReport(openFile, null, True)
    
    #generate actual teams
    index = 0;
    if debug: print('Index: '+ str(index))
    for tm in teamNums:
        if debug: print('Team # in loop: '+ str(tm))
        tmArray = []
        if debug: print('tmArray Count: '+ str(len(tmArray)))
        for i in list(range(tm)):
            person = ''
            if foundFile.lower().endswith('.xls'):
                person = str(rawList[index])
            else:
                person = str(rawList[index])[1:-1]
            if debug: print('Person in copyList: '+ person)
            tmArray.append(person)
            if debug: print('tmArray Count: '+ str(len(tmArray)))
            index += 1
            if debug: print('Index: '+ str(index))
        if debug: 
            s = ', '
            print('Team: '+ s.join(tmArray))
        teams.append(tmArray)
        
    return teams

#Generates a pretty HTML report with teams, error message, or easter egg.
#reportFile is the full path of the report file, teams is a list of lists,
#errorMsg is any error message, and egg is a special surprise if no 
#supported file is found :)
def generateReport(reportFile, teams, egg):
    if egg == False:
        teamTables = ''
        
        for team in teams:
            teamTables += createTeamTable(team).replace('teamNum', str(teams.index(team)+1))
        
        copyText = 'TeamPy Results: ' #todo this
        for team in teams:
            copyText += 'Team '+str(teams.index(team)+1)+': '
            for name in team:
                copyText += name+'; '
            copyText += '    '
        
        reportFile.write('<html><head><link href="https://cdn.jsdelivr.net/npm/bootstrap@5.1.3/dist/css/bootstrap.min.css" rel="stylesheet" integrity="sha384-1BmE4kWBq78iYhFldvKuhfTAU6auU8tT94WrHftjDbrCEXSU1oBoqyl2QvZ6jIW3" crossorigin="anonymous"></head><body width="100%" style="background-color:#FF69B4;"><div style="height:10%;width:80%;margin-left:10%;margin-top:5%;"><center><h1>TeamPy Results:</h1><br><script>function copyFunction(){navigator.clipboard.writeText("'+copyText+'")}</script><button class="button small" onclick="copyFunction()">Copy teams to clipboard</button><br></center></div><div><center>'+teamTables+'</center></div></body></html>');
    else:
        reportFile.write('<html><head><meta http-equiv="refresh" content="5; URL=https://www.youtube.com/watch?v=dQw4w9WgXcQ" /></head><body width="100%" style="background-color:#FF69B4;"><div style="height:25%;width:80%;margin-left:10%;margin-top:5%;"><center><h1>Roh-No! Something bad happened!</h1></center></div><div><center><img src="data:image/gif;base64," /></center></div></body></html>')
	
#Dynamically creates the team HTML tables
def createTeamTable(names):
    table = '<table class="table" style="display:inline-block;margin:5%;width:auto;"><thead><tr><th scope="col">Team teamNum</th></tr></thead><tbody>teamTable</tbody></table>'
    row = '<tr><td>personName</td></tr>'
    rows = ''
    for name in names:
        if debug: print('Name in table: '+name)
        rows += row.replace('personName', name)
    return table.replace('teamTable', rows)
    
